import React from 'react';
import {
    ChakraProvider,
    Box,
    Text,
    Link,
    VStack,
    Code,
    Grid,
    theme,
    Container,
} from '@chakra-ui/react';

const LandingPage = () => {
    return (
        <Container maxW='container.lg' bg='white' color='#262626'>
            "container.lg" Container
            <Box color='pink' bgColor='blue'>
                Hello
            </Box>
        </Container>

    );
}

export default LandingPage;
